import React from 'react';
import { Content, Row, Col } from '../modules/Grid';

export default function Header(props){
    return(
        <Content container='container-fluid bg-support'>
            <Row className='px-3'>
                <Col col='col-3'>
                    LOGO
                </Col>
                <Col col='col-6'>
                    LOGO
                </Col>
                <Col col='col-3'>
                    LOGO
                </Col>
            </Row>
        </Content>
    )
}
